import { StyleSheet } from "react-native"

const styles = StyleSheet.create({
  container_back: {
    position: 'absolute',
    bottom: 0,
    width: "100%",
    height: "75%",
    backgroundColor: "#000"
  },

  container: {
    flex: 1,
    backgroundColor: "#32323275",
    borderTopLeftRadius: 10,
    borderTopRightRadius: 10
  },

  container_traco:{
    width: "100%",
    heigt: "5%",
    justifyContent: "center",
    alignItems: "center"
  },

  traco:{
    fontSize: 40,
    color: "#0CBECE"
  },

  container_img:{
    backgroundColor: "#FFF",
    height: "30"
  },

  imagem:{
    height: "60%",
    width: "60%",
    borderRadius: 9999,
  },



   })
export default styles
